function App() {

class Square extends React.Component {


  render() {
    return (
      <button className="square" onClick={()=>
        {alert(this.props.value)}}>
        {this.props.value}
      </button>
    );
  }

  }
  function renderSquare(i){
    return <Square value={i} />
  }
  function newRay(j){
    alert("boo")
    for(var i=8;i<j;i++){
      renderSquare(i)
    }
  }







  return (
    <div className="App">
     <h1> Test </h1>





     {renderSquare(1)}
     {renderSquare(2)}
     {renderSquare(3)}
     <br></br>
      <br></br>
     {renderSquare(4)}
     {renderSquare(5)}
     {renderSquare(6)}
     {newRay(10)} 


    </div>
  );
}

export default App;
